gmd:identificationInfo.gmd:MD_DataIdentification.gmd:abstract.gco:CharacterString.#text:§Projet "Cèze" ZABR AE-RMC (2013 - 2017) 
Caractérisation pluridisciplinaire des échanges karst - rivière : Exemple de la Cèze au niveau du plateau karstique de Méjannes-le-Clap (Gard, France)


- Principe : Un traçage artificiel consiste à prouver (ou dans une certaine mesure peut réfuter) des relations hydrauliques entre un point d’injection du traceur (pertes, gouffres, dolines, avens, etc.) et un ou plusieurs points de restitution (source(s), piézomètre(s), etc.).

- Protocole expérimentale : Le dispositif de suivi de restitution du traceur est commun à l'ensemble des traçages, ce dispositif a été installé au niveau des sources tant côté Ardèche que côté Cèze. Ce suivi a consisté à la mise en place de fluorimètres de terrain couplés à des fluocapteurs renouvelés régulièrement et des prélèvements ponctuels d’eaux.

- Moyens analytiques : 
1_ Fluorimètre/Turbidimètre portatif Aquafluor® à 2 canaux Fluorescéine/Rhodamine (limite de détection à 0,4 ppb pour la Fluorescéine et la Rhodamine) ;
2_Fluorimètre/Turbidimètre de terrain GGUN-FL30 à 4 canaux (limite de détection à 2 x 10-11 g/ml pour la fluorescéine) ;
3_ Analyses en laboratoire pour les échantillons d'eau et les fluocapteurs (Sciences Environnement à Besançon) avec un spectromètre de luminescence (Perkin Elmer – LS 50 B). dont la limite de détection de la fluorescéine est de 0,02 ppb.

- Mesures : 
1_Grotte Flandin (X_l93 = 811988 m ; Y_l93 = 6357335 m ; Z_NGF = 125 m) injection de 10 kg de fluorescéine le 29/03/14 ;
2_Affluent Roméjac (X_l93 = 805906 m ; Y_l93 = 6355259 m ; Z_NGF = 119 m) injection de 3 kg d'éosine le 06/05/14 ;
3_Salle Rouge de l'Aven d'Orgnac (X_l93 = 812602 m ; Y_l93 = 6358892 m ; Z_NGF = 155 m) injection de 10 kg de rhodamine le 14/11/14 ; 
4_Perte de la Cèze au niveau de Rochegude (X_l93 = 801709 m ; Y_l93 = 6349297 m ; Z_NGF = 110 m) injection de 10kg de floorescéine le 21/07/15.

- Auteurs : J. Jolivet, J. Ré-Bahuaud, H. Chapuis, D. Graillot avec l'assistance du Groupement Associatif de Spéléologues d'Orgnac-L'Aven et Labastide-de-Virac (GASOIL).
- Période : 2014 et 2015
- Format : Tableur

